import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Nav />
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/movie">
            <Movie />
          </Route>
          <Route path="/about(/:id)" component={Watch} />
          <Route component={Notfound} />
        </Switch>
      </div>
      <div></div>
    </BrowserRouter>
  );
}

export default App;
